DROP TABLE IF EXISTS `fa_shop_exchange_order`;
CREATE TABLE `fa_shop_exchange_order`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '会员ID',
  `exchange_id` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '兑换ID',
  `type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '类型',
  `orderid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单号',
  `nums` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '数量',
  `score` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '兑换积分',
  `receiver` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收件人',
  `mobile` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '电话',
  `address` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地址',
  `memo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `reason` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '原因',
  `expressname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '快递名称',
  `expressno` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '快递单号',
  `ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'IP',
  `useragent` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'UserAgent',
  `createtime` bigint(16) NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  `status` enum('created','inprogress','rejected','delivered','completed') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'created' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '积分兑换订单' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_exchange_order
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_freight
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_freight`;
CREATE TABLE `fa_shop_freight`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '名称',
  `type` tinyint(1) NULL DEFAULT NULL COMMENT '是否包邮:1=按件计,2=按重计',
  `weigh` int(10) NOT NULL DEFAULT 0 COMMENT '权重',
  `switch` tinyint(1) NOT NULL DEFAULT 0 COMMENT '开关',
  `num` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '默认件/重',
  `price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '默认价格',
  `continue_num` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '续件/续重',
  `continue_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '续费',
  `createtime` bigint(16) NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '运费模板' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_freight
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_freight_items
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_freight_items`;
CREATE TABLE `fa_shop_freight_items`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `freight_id` int(10) NULL DEFAULT NULL COMMENT '模板id',
  `first_num` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '首件/首重',
  `first_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '首费',
  `continue_num` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '续件/续重',
  `continue_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '续费',
  `area_ids` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '地区ids',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '指定地区包邮:0=否,1=按件,2=按金额',
  `postage_area_ids` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '包邮地区ids',
  `postage_num` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '满几件包邮',
  `postage_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '满金额包邮',
  `createtime` bigint(16) NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '运费模板字表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_freight_items
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_goods
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_goods`;
CREATE TABLE `fa_shop_goods`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `category_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '类别ID',
  `subtitle` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '子标题',
  `attribute_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '属性值ids',
  `brand_id` int(10) NULL DEFAULT NULL COMMENT '品牌ID',
  `goods_sn` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '货号',
  `title` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品标题',
  `keywords` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '关键字',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '描述',
  `marketprice` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '市场售价',
  `price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '商城售价',
  `stocks` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '库存',
  `sales` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '销量',
  `guarantee_ids` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '服务保障',
  `star` int(10) NULL DEFAULT 0 COMMENT '星级',
  `views` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '浏览次数',
  `comments` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '评论数',
  `shares` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分享次数',
  `image` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '缩略图',
  `images` varchar(1500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '预览图',
  `content` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品内容详情',
  `corner` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '角标文字',
  `flag` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '标志',
  `spectype` tinyint(1) NULL DEFAULT 0 COMMENT '规格类型:0=单规格,1=多规格',
  `weight` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '重量(kg)',
  `isvirtual` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '虚拟物品',
  `freight_id` int(10) NULL DEFAULT NULL COMMENT '运费模板ID',
  `weigh` int(10) NOT NULL DEFAULT 1 COMMENT '排序',
  `createtime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  `deletetime` bigint(16) NULL DEFAULT NULL COMMENT '删除时间',
  `status` enum('normal','hidden','soldout') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'normal' COMMENT '状态',
  `goods_type` int(11) NOT NULL DEFAULT 10 COMMENT '10销售订单 20预约订单',
  `goods_reservation_status` int(11) NOT NULL DEFAULT 10 COMMENT '10进行中20退款',
  `goods_reservation_time` int(11) NULL DEFAULT NULL COMMENT '退款时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `category_id`(`category_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 46 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_goods
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_goods_attr
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_goods_attr`;
CREATE TABLE `fa_shop_goods_attr`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `attribute_id` int(10) NULL DEFAULT NULL COMMENT '属性id',
  `value_id` int(10) NULL DEFAULT NULL COMMENT '属性值id',
  `goods_id` int(11) NULL DEFAULT NULL COMMENT '商品id',
  `createtime` bigint(16) NULL DEFAULT NULL COMMENT '添加时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `attribute`(`attribute_id`, `value_id`, `goods_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品属性' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_goods_attr
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_goods_renew
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_goods_renew`;
CREATE TABLE `fa_shop_goods_renew`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `goods_id` int(11) NOT NULL COMMENT '商品id',
  `renew_year` int(11) NOT NULL COMMENT '年份',
  `renew_price` decimal(10, 2) NOT NULL COMMENT '价格',
  `weigh` int(11) NOT NULL DEFAULT 100 COMMENT '排序',
  `switch` int(11) NOT NULL DEFAULT 1 COMMENT '开关',
  `createtime` int(11) NOT NULL COMMENT '创建时间',
  `updatetime` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 464 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品续费表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_goods_renew
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_goods_sku
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_goods_sku`;
CREATE TABLE `fa_shop_goods_sku`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `goods_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品ID',
  `goods_sn` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '货号',
  `sku_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'SKU',
  `image` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '规格封面',
  `price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '价格',
  `marketprice` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '市场价',
  `stocks` int(10) NOT NULL DEFAULT 0 COMMENT '库存数量',
  `sales` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '销量',
  `weigh` double UNSIGNED NOT NULL DEFAULT 0 COMMENT '权重',
  `createtime` bigint(16) UNSIGNED NOT NULL DEFAULT 0 COMMENT '添加时间',
  `updatetime` bigint(16) UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 57 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品SKU表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_goods_sku
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_goods_sku_spec
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_goods_sku_spec`;
CREATE TABLE `fa_shop_goods_sku_spec`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `goods_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品ID',
  `spec_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '规格ID',
  `spec_value_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '规格值ID',
  `createtime` bigint(16) UNSIGNED NULL DEFAULT 0 COMMENT '添加时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 48 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_goods_sku_spec
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_guarantee
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_guarantee`;
CREATE TABLE `fa_shop_guarantee`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '名称',
  `image` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '图片',
  `intro` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '服务保障',
  `createtime` bigint(16) NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  `status` enum('normal','hidden') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'normal' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '服务保障' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_guarantee
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_menu
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_menu`;
CREATE TABLE `fa_shop_menu`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `pid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '父ID',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '名称',
  `url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '链接',
  `weigh` int(10) NULL DEFAULT 0 COMMENT '排序',
  `createtime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  `status` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '菜单表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_menu
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_navigation
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_navigation`;
CREATE TABLE `fa_shop_navigation`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '名称',
  `size` int(2) NULL DEFAULT 60 COMMENT '图标大小',
  `image` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图片',
  `path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '路径',
  `switch` tinyint(1) NOT NULL DEFAULT 0 COMMENT '开关',
  `weigh` int(10) NOT NULL DEFAULT 0 COMMENT '权重',
  `createtime` bigint(16) NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '导航配置' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_navigation
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_order
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_order`;
CREATE TABLE `fa_shop_order`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `order_sn` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT ' 订单号,唯一',
  `user_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id,',
  `address_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '收款地址ID',
  `province_id` int(10) NULL DEFAULT NULL COMMENT '省id',
  `city_id` int(10) NULL DEFAULT NULL COMMENT '市id',
  `area_id` int(10) NULL DEFAULT NULL COMMENT '区域ID',
  `user_coupon_id` int(10) NULL DEFAULT NULL COMMENT '优惠券记录ID',
  `receiver` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '收货人的姓名',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '收货人的地址',
  `zipcode` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '收货人的邮编',
  `mobile` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '收货人的手机',
  `amount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '订单总金额',
  `discount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '优惠金额',
  `shippingfee` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '配送费用',
  `goodsprice` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '商品总费用',
  `saleamount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '应付款金额',
  `payamount` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '实际付款金额',
  `paytype` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '用户选择的支付方式名称',
  `method` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方法',
  `transactionid` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '交易流水号',
  `expressname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '快递名称',
  `expressno` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '快递单号',
  `createtime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `updatetime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '更新时间',
  `expiretime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '过期时间',
  `paytime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '支付时间',
  `refundtime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '退货时间',
  `shippingtime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '配送时间',
  `receivetime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '收货时间',
  `canceltime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '取消时间',
  `deletetime` bigint(16) UNSIGNED NULL DEFAULT NULL COMMENT '删除时间',
  `orderstate` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单状态:0=正常,1=已取消,2=已失效,3=已完成,4=退货退款中',
  `shippingstate` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '配送状态:0=未发货,1=已发货,2=已收货',
  `paystate` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付状态:0=未付款,1=已付款',
  `memo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `status` enum('normal','hidden') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'normal' COMMENT '状态:normal=正常,hidden=隐藏',
  `order_type` int(11) NOT NULL DEFAULT 10 COMMENT '10商品订单20安装订单',
  `order_renew_status` int(11) NOT NULL DEFAULT 10 COMMENT '10未续费20续费30到期',
  `order_renew_time` int(11) NULL DEFAULT NULL COMMENT '到期时间',
  `news_remind` int(11) NOT NULL DEFAULT 1 COMMENT '1 未提醒 2提醒',
  `install_status` int(11) NOT NULL DEFAULT 1 COMMENT '1待安装2上门安装',
  `install_status_remind` int(11) NOT NULL DEFAULT 1,
  `renew_refund_status` int(11) NOT NULL DEFAULT 1 COMMENT '1未退款2已退款',
  `renew_refund_time` int(11) NULL DEFAULT NULL COMMENT '退款时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `order_sn`(`order_sn`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE,
  INDEX `orderstate`(`orderstate`) USING BTREE,
  INDEX `paytime`(`paytime`) USING BTREE,
  INDEX `createtime`(`createtime`) USING BTREE,
  INDEX `province_city_area`(`province_id`, `city_id`, `area_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 21 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_order
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_order_action
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_order_action`;
CREATE TABLE `fa_shop_order_action`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '流水号',
  `order_sn` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '订单编号',
  `operator` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '操作人',
  `memo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '操作记录(备注)',
  `createtime` bigint(16) UNSIGNED NOT NULL DEFAULT 0 COMMENT '操作时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `order_id`(`order_sn`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 63 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单操作记录表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fa_shop_order_action
-- ----------------------------

-- ----------------------------
-- Table structure for fa_shop_order_aftersales
-- ----------------------------
DROP TABLE IF EXISTS `fa_shop_order_aftersales`;
CREATE TABLE `fa_shop_order_aftersales`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `order_id` int(10) NULL DEFAULT NULL COMMENT '订单id',
  `order_goods_id` int(10) NULL DEFAULT NULL COMMENT '订单商品id',
  `user_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '用户ID',
  `type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '售后类型:1=仅退款,2=退款退货',
  `nums` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '数量',
  `realprice` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '商品实付金额',
  `shippingfee` tinyint(1) NULL DEFAULT 0 COMMENT '邮费',
  `refund` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '退款金额',
  `reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '退款原因',
  `images` varchar(2500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '补充图片',
  `mark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '卖家备注',
  `status` tinyint(1) UNSIGNED NULL DEFAULT 1 COMMENT '状态:1=待审核,2=审核通过,3=审核拒绝',
  `expressname` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '快递名称',
  `expressno` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '快递单号',
  `createtime` bigint(16) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `updatetime` bigint(16) UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '退货单表' ROW_FORMAT = Compact;

