INSERT INTO `fa_admin_log` VALUES (581, 1, 'admin', '/vBzqWHTZof.php/shop/page/edit/ids/2?dialog=1', '简单商城 / 单页管理 / 修改', '{\"dialog\":\"1\",\"__token__\":\"***\",\"row\":{\"type\":\"page\",\"title\":\"用户注册协议\",\"image\":\"\",\"content\":\"\\r\\n\\t《共享净水器用户服务协议》\\r\\n\\r\\n客户（下为甲方”，与青岛碧丰源环保科技有限公司（下为乙方”为了签订租赁协议）\\r\\n:\\r\\n双方达成以下约定：\\r\\n甲方首先要按照乙方租赁条件下单，甲方必须提供真实准确的用户资料，经乙\\r\\n方核实甲方的信用情况后才能同意租赁。租赁合同自双方同意安装产品之日起正式生效。\\r\\n第二条：租赁期限及约定期限\\r\\n1、租赁约定期限根据首次安装产品试用 7日后计算。\\r\\n2、租赁使用净水机期限第六年起根据净水机的使用情况给甲方更换一台新机.\\r\\n每年乙方需甲方提供使用净水机的维护、保养、滤芯免费更换等服务，则甲方需向乙方每年交纳管理服务费。\\r\\n3、净水机租金按年支付，首次支付初装费以及一年租金，其余租金按年度一次性支付次年租金。（可按实际适当调整放宽）\\r\\n4、甲方只有设备的使用权，机器的所有权归乙方所有，设备到期后或者甲方退租后设备由乙方免费上门拆机回收。\\r\\n第三条：产品的交付及安装（包括转移安装）\\r\\n1、甲方认购的产品将安装到甲方要求的场地，由乙方承担此时的运费及安\\r\\n装费。如果发生乙方规定的基本运费及安装费以外的费用时，由甲方自行承担。\\r\\n2、甲方收到产品时，对产品核实无误后，在租赁确认书上签字确认，此时则视为已\\r\\n确认产品的状态性能正常。\\r\\n3、转移安装各 1 次由公司承担费用，第二次起由顾客自己承担相应费用。迁移费\\r\\n用乙方统一规定。\\r\\n4、甲方指定水源 3米范围内的水管安装材料免费，水源超出 5 米以外的安装材料费\\r\\n用由甲方承担。因甲方原因需移动已经按甲方指定位置安装的净水机，\\r\\n其移动中产生的必要材料费用，由甲方支付（材料费用为10元\\/米）.\\r\\n5、超出安装以及次数以后同地移机由甲方负责人工费每次每台 100 元及相应的材料费用。\\r\\n6、异地移机除以上费用外甲方需另付移机费用每次\\/每台150 元。\\r\\n第四条：租金的缴纳\\r\\n1、甲方根据乙方的指定方法应将租赁款支付给乙方的服务人员。\\r\\n2、甲方应按确认约定缴纳产品租金，可选择租金缴纳方法。\\r\\n3、甲、乙双方在约定的缴纳期限内交付季度租金，每一年度到期之前7日内支付下一\\r\\n年度租金，乙方向甲方提供免费的定期检查维护服务。\\r\\n第五条：收据及发票\\r\\n1、甲方填写的租赁确认书可代替收据，如需要正式发票，甲方需要支付发票的税点。\\r\\n2、服务人员收取租金时提供乙方出具的简易发票（收据），甲方需要国家承认正式\\r\\n发票时，由乙方通过邮箱方式交付客户。\\r\\n\\r\\n第六条：产品的使用、保管及维护\\r\\n1、甲方应遵循产品说明书使用产品，并做好妥善管理。\\r\\n2、甲方需要变更收货人、收货地址及联系电话，或者将产品转移到其他场地时，应\\r\\n提前获得乙方同意(通知)•因甲方的疏忽对待或人为因素而发生的损失,由甲方自行承担。\\r\\n3、甲方不得去除、弄脏产品上的乙方所有权标识、固定标志等。\\r\\n4、甲方应有就第三人主张权利时及时通知乙方提出案外人异议的义务。\\r\\n5、商用净水机只限于在室内场所使用，由甲方负责净水机安全，提供电源\\r\\n和水源。甲方不可私自移机，且不得将净水机转租、甲方在约定缴纳期内交付年租金时，乙方向甲方提供免费的定期检查服务。\\r\\n6 在租赁合同期内转借他人，或做其他不当用途，若违反约定所造成的意外损害，由\\r\\n甲方承担全部责任。\\r\\n7、乙方向甲方租赁的净水机提供相关的技术及售后服务，包括对净水机及耗材进行\\r\\n免费维护和保养（甲方原因造成的损害除外），并提供设备检测和维护，以保证水质卫生、安全达到规定标准。\\r\\n8、如设备出现人为损坏，甲方应在 12 小时内通知乙方，由乙方负责维修，甲方承担\\r\\n因此产生的相关费用。甲方需对未及时通知而造成设备持续损害承担相应责任。如遗失，则按净水机价值予以赔偿。\\r\\n第七条：管理义务•因甲方故意造成产品的故障、损坏时，甲方应承担维修及配件更\\r\\n换费用。\\r\\n第八条：解除合同\\r\\n1、由于甲方地址搬迁、解体等不可抗拒的外部原因导致合同不能正常履行的，协议\\r\\n自动解除，甲方退还乙方净水机:除以上原因，甲方无故单方面解除合同，所产生的损失,由甲方自行负责，并将机器归还给乙方。\\r\\n2、租金的支付为先付费用后使用的方式，在正常租期内因甲方原因造成乙方回收机\\r\\n器租金不予退还。如更换不同型号的净水机产生租金差价时只补交不退还。\\r\\n第九条：约定期限过后租赁装机产品的注意事项\\r\\n1、租赁期内产品使用权归属甲方。\\r\\n2、协议到期时，产品产权归属乙方。\\r\\n3、本协议自客户下单安装后自动生效，具法律效力。协议履行过程中，如\\r\\n有争议，双方应协商解决。如协商不成，需在乙方所在地提起仲裁。\",\"seotitle\":\"用户服务协议\",\"keywords\":\"\",\"description\":\"《共享用户服务协议》\",\"diyname\":\"agreement\",\"showtpl\":\"page\",\"views\":\"432\",\"weigh\":\"1\",\"parsetpl\":\"0\",\"status\":\"normal\",\"flag\":[\"\"]},\"ids\":\"2\"}', '112.255.1.224', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/108.0.5359.125 Safari/537.36', 1714542077);
